    {
      text: "Enter a new goal",
      id: "g1",
    },

    { text: "Fun with this React project", id: "g2" },
  ]);
  return (
    <div>
      <section id="forms">
        <GoalInput />
      </section>
    </div>
  );
};

export default App;
